import './Skills.css';
import Page from "../../components/Page/Page.js";

function Skills(props) {
  return (
    <Page id="Skills" header="Skills">
      <p className="Skills-description">My name is Ryan Schmid, a computer science Master's student at Lehigh Univeristy. 
      Before my time as a graduate student, I completed two Bachelor's degrees at Lehigh, 
      one in Computer Engineering and the other in Inegrated Business and Engineering (IBE) with a major in Finance 
      as part of the university's IBE Honors Program. This website is a virtual resume that displays many of 
      the experiences I have had at Lehigh as well as some projects and achievements I have done and made along the way.</p>
    </Page>
  );
}

export default Skills;
